import React from 'react';
import './App.css';
import GenerateGarden from "./component/GenerateGarden";

const theme = {
  dark: {
    background: "#555",
    color: "FFF"
  },
  light: {
    background: "#FFF",
    color: "#555"
  }
}

React.createContext(theme.dark)

function SearchForm({theme}){
  return <div>
    <button style={theme}>AAAAAA</button>
  </div>
}

function Toolbar({theme}){
  return <div>
    <SearchForm />
    <button style={theme}>AAAAAA</button>
  </div>
}

function App() {

  return (
      <div className="App">
          <h1>My Emoji Garden</h1>
          <Toolbar theme={theme.dark}/>
          <GenerateGarden/>
      </div>
  );
}

export default App;
